//A simple jsx element to display the home page
//wrapping the jsx element in the Dashboard component to send as a child
import React, { useEffect, useState } from "react";
import { Dashboard } from "../layout/Dashboard";
import { Products } from "../components/products";
import axios from "axios";
import { E_URL } from "../url";

export const Home = () => {
  return (
    <Dashboard>
      <div className="HOME">
        <h1>Home</h1>
        <div className="Container">
          <img
            src="https://www.pexels.com/photo/black-and-gray-motherboard-2582932/"
            alt="motherboard"
          />
        </div>
        <Products />
      </div>
    </Dashboard>
  );
};
